import "./App.css";

function App() {
  //
  const [isOpenPopUp, setIsOpenPopUp] = useState(false);

  function onOpenPopUp() {
    setIsOpenPopUp(!isOpenPopUp);
  }
  //
  return (
    <div className="App">
      <button>Open Text</button>
      <br />
      <br />
      <text>Hello </text>
    </div>
  );
}

export default App;
